import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import Table from "react-bootstrap/Table";
import Button from "react-bootstrap/Button";
import { Col, Container, Row } from "react-bootstrap";
import axios from "axios";
function StdList() {
  const [data, setData] = useState([]);

  const navigate = useNavigate();
  useEffect(() => {
    getrecord();
  }, []);

  const getrecord = () => {
    axios
      .get("http://localhost:5000/getdata")
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  };

  const Edit = (id) => {
    navigate("/edit/" + id);
  };
  const Details = (id) => {
    navigate("/details/" + id);
  };

  const Delete = (id) => {
    axios
      .delete(`http://localhost:5000/deletedata/${id}`)
      .then(() => {
        getrecord();
      })
      .catch((error) => {
        console.error("Error deleting data:", error);
      });
  };
  return (
    <Container>
      <Row>
        <Col xs={12} lg={4} xl={3} className="col-xs-12 col-cards  mt-4">
          <>
           
            <h4>
              Add Student Data:
              <Link to="/create">
                <Button
                  className="mb-3 p-1"
                  as="input"
                  variant="info"
                  type="button"
                  value="Add"
                />
              </Link>
            </h4>
            <hr />
           
              

              {data.map((dta, id) => {
                return (
                  <>
                    <Col
                      xs={12}
                      lg={4}
                      xl={3}
                      className=" col-xs-12 col-cards  mt-4"
                    >
                      <Card key={i} className="cards m-3">
                        <center>
                         
                          <Card.Title>{ele.name}</Card.Title>
                        </center>
                        <center>
                          {" "}
                          <Card.Img
                            className="card-img"
                            variant="top"
                            style={{
                              width: "50%",
                            }}
                            src={ele.image}
                          />{" "}
                        </center>
                        <Card.Body>
                          <h3>Reviews:</h3>
                          <h4>
                            {ele.rating}
                            <br />
                          </h4>
                          <br />
                          <center>
                            {" "}
                            <h3>
                              <Ratingicon r={ele.rating} />
                            </h3>
                          </center>
                          <Card.Text>
                            <Card.Text>
                              <p>Original Price:₹{ele.orprice}</p>
                              <p>
                                Offered Price:₹<del>{ele.ofprice}</del>
                              </p>
                              <Percentage or={ele.orprice} of={ele.ofprice} />
                            </Card.Text>
                          </Card.Text>
                          <Button
                            className="mt-2"
                            variant="primary"
                            onClick={() => clicking(ele)}
                          >
                            Add To Card
                          </Button>
                          &nbsp;&nbsp;&nbsp;&nbsp;
                          <Button
                            className="mt-2"
                            as="input"
                            type="button"
                            value="Delete"
                            onClick={() => Delete(ele.id)}
                          />
                        </Card.Body>
                      </Card>
                    </Col>
                  </>
                );
              })}
         
          </>
        </Col>
      </Row>
    </Container>
  );
}
export default StdList;
